import Vue from 'vue';
import App from './App.vue';
import 'bootstrap/dist/css/bootstrap.css';  // Importa Bootstrap
import './assets/css/style.css';  // Importa tu archivo CSS personalizado
 // Importa tu archivo CSS personalizado

Vue.config.productionTip = false;

new Vue({
  render: h => h(App)
}).$mount('#app');
